import React from 'react';
import Contact from './Contact'

function PropLearning(){

  return(
    <div>
      <Contact
      image = "https://www.kashimath.org/wp-content/uploads/2015/01/Sudhindra-Thirtha-02.jpg"
      name = "HH Sudheendra Teertha Swamiji"
      phone = "630.445.6409"
      email = "vs@hotmail.com"/>


    <Contact
    image = "https://www.kashimath.org/wp-content/uploads/2014/12/Bhuvanendra-Thirtha.jpg"
    name = "HH Bhuvanendra Teertha Swamiji"
    phone = "630.445.6409"
    email = "vs@hotmail.com"/>

    </div>
  );
}

export default PropLearning;
